        "name": "Natalie Steger",
        "descriptionDe": "Was tun, wenn der Massenmarkt keine Antwort auf ein persönliches Problem bietet? Man entwickelt selbst ein Produkt, erkennt einen breiteren Need dafür und baut kurzerhand ein Unternehmen auf. So ist es Natalie Steger und Annika Götz ergangen, als sie 2019 feststellten, dass das Thema „Baden“ seit Jahren nicht neu gedacht wurde. Mit BADESOFA haben sie eine Brand entwickelt, die sich der Mission „rethink design comfort“ im Wellnessbereich verschrieben hat. Ihr erstes Produkt, das BADESOFA Badewannenkissen, begeisterte u.a. in der Gründershow „Die Höhle der Löwen“. Mit dem innovativen SAUNASOFA bauen sie ihre Produktpalette weiter aus. Natalie lebt mit ihrem Mann und den 3 Kindern in Köln und sagt: „Als Mutter zu gründen, war die beste Entscheidung meiner beruflichen Karriere.“",
