        "name": "Alisa Jahnke",
        "descriptionDe": "Alisa Jahnke war schon immer klar, dass sie sich selbstständig machen möchte. Während ihres Auslandssemesters 2013 auf Hawaii, hat sie sich unsterblich in die hawaiianische Lebenskultur verliebt. Sie wollte den Aloha-Vibe unbedingt nach Deutschland bringen und da sie schon immer ein großer Fan von Schmuck war, gründete sie zusammen mit Frederik Jahnke und Etienne Espenner 2016 die Schmuck- und Lifestyle Brand PURELEI. Influencer- und Partnermarketing ist ein wichtiger Bestandteil bei PURELEI – welches die Brand nicht nur in der DACH Region bekannt gemacht hat, sondern mittlerweile auch in ganz Europa. Seit Alisa 2020 Mutter wurde ist es ihr besonders wichtig werdende Mütter und Väter im Unternehmen zu unterstützen – denn eine Karriere ist auch mit Kind/ern möglich, egal ob als Frau oder Mann.",
        "descriptionEn": "Alisa Jahnke always knew she wanted to be her own boss. During a semester abroad in Hawaii in 2013, she fell in love with Hawaiian culture and was determined to bring the aloha vibe to Germany. As she was a big fan of jewelry she founded jewelry and lifestyle brand PURELEI together with Frederik Jahnke and Etienne Espenner in 2016. Influencer and partner marketing are essential pillars to the brand, which has not only been a success at home, but throughout Europe as well. After becoming a mother for the first time in 2020, Alisa has made it a point to support expecting mothers and fathers in her company, as it is her firm belief that you should not have to choose between being a parent and having a career.",
