        "name": "Jason Modemann",
        "descriptionDe": "Jason Modemann ist Gründer und Geschäftsführer der in DACH führenden Social Media Performance Agentur Mawave Marketing GmbH. Hier verantwortet er sowohl die strategische Ausrichtung als auch das Business Developement und ist Experte für Social Media Advertising, Performance Marketing und Plattforminnovationen. Kunden wie About You, Hello Fresh und Snocks vertrauen auf seine Expertise und Fachkompetenz. Mit seinem 50-köpfigen Team verwaltet er monatlich ein Werbebudget von über 10 Mio. Euro. Mawave ist spezialisiert auf die Konzeption und optimierte Ausspielung von holistischen Social Media Kampagnen auf allen relevanten sozialen Plattformen und arbeitet eng mit Facebook, Instagram, Pinterest und TikTok zusammen.",
