        "name": "Céline Flores-Willers",
        "descriptionDe": "Céline Flores Willers gehört mit 120.000 Followern zu den bekanntesten deutschen Influencern auf LinkedIn. Für ihre Beiträge zu den Themen Innovation, Entrepreneurship und Zukunftstrends wurde sie bereits 3x als LinkedIn Top Voice ausgezeichnet. Nachdem sie vermehrt Anfragen für LinkedIn Trainings erhielt, entschied sie sich ein Unternehmen zu gründen und ihre Learnings weiterzugeben. The People Branding Company ist in nur 1,5 Jahren auf 15 Mitarbeiter herangewachsen und zu den Kunden zählen viele renommierte Unternehmen, wie unter anderem Accenture, SAP und Fujitsu. Seit Anfang 2021 kann sich Céline außerdem Co-Herausgeberin & Co-Autorin des Spiegel-Bestsellers „Zukunftsrepublik“ nennen.   ",
