        "name": "Dominik Brichta",
        "descriptionDe": "Dominik begann schon als Schüler, Dinge im Internet zu verkaufen. Neben dem Studium und einem Nebenjob in der elterlichen Anwaltskanzlei eröffnete er im Alter von 18 Jahren seinen ersten Webshop. Er wollte von Grund auf etwas Eigenes aufbauen. Im Jahr 2012 folgte die Gründung eines Joint Ventures mit Peter Chaljawski, der damals unter dem Firmenname Chal-Tec vor allem Veranstaltungstechnik auf Online-Marktplätzen verkaufte. 2019 ging aus Chal-Tec die Berlin Brands Group hervor, eine globale E-Commerce-Firma, unter deren Dach Produkte von 56 Marken weltweit verkauft werden. Im Rahmen eines Investorenwechsels wurde die BBG im September 2021 zum Unicorn. Co-Founder Dominik Brichta agiert heute als Chief M&A Officer des Unternehmens.",
        "descriptionEn": "Dominik began selling things online while still in primary school. While going to university and having his first part-time job in his parent’s legal practice, he opened up his first webshop when he was just 18 years old. In 2012, he founded his first joint venture with Peter Chaljawski, then called Chal-Tec, which primarily sold event equipment on online marketplaces. In 2019, Chal-Tec morphed into the Berlin Brands Group, a global eCommerce company, whose portfolio includes 56 brands that are sold worldwide. After a change in investors, BBG im became a unicorn in September 2021. Today, co-founder Dominik Brichta acts as the company Chief M&A Officer.",
