        "name": "Georgia Näder",
        "descriptionDe": "Georgia Näder, Jahrgang 1997 und vierte Generation einer Unternehmerfamilie, studierte in Barcelona Business Administration und schließt aktuell ihren Masterabschluss in Business Administration und Innovation in Healthcare an der Copenhagen Business School ab. Im Alter von 20 Jahren wurde sie zur Aufsichtsrätin der Ottobock SE & Co KGaA berufen und ist heute eine der jüngsten Aufsichtsrätinnen Deutschlands. Sie setzt sich für Themen wie Nachhaltigkeit, Employer Branding und Recruiting sowie Digitalisierung ein. Neben Studium und Engagement im Familienunternehmen gründete die Urenkelin von Otto Bock 2018 ihr eigenes Start-up Maluwa Superfoods.",
        "descriptionEn": "Georgia Näder, born in 1997 and fourth generation of an entrepreneurial family, studied Business Administration in Barcelona and is currently completing her Master's degree in Business Administration and Innovation in Healthcare at Copenhagen Business School. At the age of 20 she was appointed to the supervisory board of Ottobock SE & Co KGaA and is now one of the youngest female supervisory board members in Germany. She is committed to topics such as sustainability, employer branding and recruiting as well as digitalization. In addition to her studies and involvement in the family business, the great-granddaughter of Otto Bock founded her own start-up Maluwa Superfoods in 2018.",
