        "name": "Dr. Kati Ernst",
        "descriptionDe": "Kati hat zusammen mit ihrer Mitgründerin Kristine Mitte 2018 ooia gegründet. Das Unternehmen verkauft nicht mehr „nur“ erfolgreich Periodenunterwäsche und hat 150.000 Kund:innen, sondern versteht sich als Female Empowerment Company, mit lebhafter Community, die öffentliche Diskussionen rund um die Themen Female-centric Products und „weibliches“ Gründen anregt. Kati verantwortet bei ooia Marketing und Finanzen, war zuvor zwölf Jahre bei der Unternehmensberatung McKinsey und reist mit ihrem Mann und drei Kindern jedes Jahr ein Paar Monate durch die Welt.",
        "descriptionEn": "Together with her co-founder Kristine, Kati founded ooia in 2018. The company has moved on from “only” selling period underwear; it now has over 150K regular customers and views itself as a female empowerment company, with a vibrant community that engages in open discussion on female-centric products and female founding. At ooia, Kati heads up marketing and finance and spent over a decade at McKinsey prior to founding ooia. For a couple of months every year, she travels around the world with her husband and three kids",
