        "name": "Saravanan Sundaram",
        "descriptionDe": "Saravanan Sundaram ist Director of Marketing und E-Commerce bei fynax. Seinen Ursprung hat er in der Retail-Branche gemacht. Nach vielen Jahren bei einem namenhaften Modelabel, ist er in die Berliner Start-Up-Szene eingetaucht. Nach einigen Stationen, wie u.a. bei GROUPON, Quandoo und Lemoncat hat er bei Deutschlands größter Steuerberatungsgruppe, der ETL-Gruppe, gestartet. Mit seiner Kollegin Nadja Müller verantwortet er den Bereich der Steuerberatung im E-Commerce, und somit fynax. Nebenbei haben sie beide noch den Podcast „Thanks for Shopping“ (prod. Von Podstars by OMR). Außerdem ist Saravanan Kommunalpolitiker in Berlin und Wertebotschafter bei GermanDream.",
