        "name": "Nadja Müller",
        "descriptionDe": "Nadja Müller ist Steuerberaterin und Head of E-Commerce bei fynax. Nach verschiedenen Stationen bei großen Wirtschaftsprüfungs- und Steuerberatungsgesellschaften ist Sie zu Home24, einem Online-Möbelhändler, gewechselt. Dort ist sie erstmals mit dem Thema E-Commerce und Online-Handel in Berührung gekommen und hat sich einige Jahre intensiv mit den steuerrechtlichen Thematiken rundum Online-Handel beschäftigt. Seit dem lässt Sie das Thema nicht mehr los. Sie arbeitet neben Ihrer eigenen Kanzlei und fynax auch als Referentin für den NWB Verlag und schult interessierte Steuerberater und Fachangestellte im Bereich E-Commerce und dessen steuerlichen Besonderheiten. Zusammen mit ihrem Kollegen Saravanan Sundaram verantwortet sie in der ETL-Gruppe die spezialisierte Steuerberatung für Online-Händler und ist Mit-Host beim fynax-Podcast \"Thanks for Shopping\" (prod. von Podstars by OMR).",
