        "name": "Niko \"Backspin\" Hüls",
        "descriptionDe": "Niko ist seit über 20 Jahren Hip-Hop-Journalist und hat 2009 BACKSPIN, das mittlerweile älteste noch aktive Hip-Hop Magazin in Deutschland, übernommen und vom Fan-Magazin zum multidigitalen Unternehmen umgebaut. In den letzten Jahren hat er nicht nur exklusive Interviews mit den Größen der Rapszene geführt, sondern auch mit Hip-Hop fremden Marken zusammengearbeitet. Ob Produktionen für Strg_F, Arte Tracks und DAZN oder die Arbeit als Consultant – Niko ist der Gatekeeper, wenn es darum geht, Hip-Hop und Urban Culture mit authentischer Zusammenarbeit im Marketing zu verknüpfen. ",
        "descriptionEn": "Niko has been active as a hip-hop journalist for over two decades and in 2009 he took over BACKSPIN, the longest-running currently active hip-hop magazine in the Fatherland, reshaping it into a multidigital company. Recently, he’s not only been conducting exclusive interviews with the biggest names on the German hip-hop scene, but also worked closely with brands who are otherwise newbies to hiphop culture. From productions with Strg_F, Arte Tracks and DAZN to his work as a consultant, Niko is a gatekeeper when it comes to combining hip-hop and urban culture with authentic marketing. ",
