        "name": "Phillip Böndel",
        "descriptionDe": "Nachdem Philipp Böndel als Berater von einigen der bekanntesten Rapper Deutschlands wie Kool Savas, Eko Fresh und Azad unterwegs war, baut er ab 2014 erst die Digitalabteilung der Düsseldorfer Kreativagentur Butter aus und wird Ende 2017 Teil der Geschäftsführung. Seit 2020 veröffentlicht er mit Tobias Kargoll den Podcast „LRNINGS“ unter dem Dach der Handelsblatt Media Group. 2021 gründet das Duo mit The Ambition Deutschlands erstes Beratungsunternehmen für Hiphop-Kultur. ",
        "descriptionEn": "After working as an adviser for some of Germany’s most well-known rappers, including Kool Savas, Eko Fresh and Azad, Philipp Böndel began expanding the digital department at the Dusseldorf-based creative agency Butter in 2014 and was appointed to the executive board in late 2017. Since 2020, he has been involved in the “LRNINGS” podcast along with Tobias Kargoll, produced by the Handelsblatt Media Group. In 2021, the duo founded Germany’s first consulting agency for hiphop culture in The Ambition. ",
