        "name": "Laura Moser",
        "descriptionDe": "Laura Moser ist selbstständige Artist-und Produktmanagerin in der Musikindustrie. Neben Ihrer damaligen Tätigkeit als Produktmanagerin für das Majorlabel Columbia/Sony (z.B Kampagne Die Fantastischen Vier) Music und Ihren Aufträgen bei bekannten Management Agenturen wie „Das Maschine“, oder dem damaligen Label der 187 Straßenbande und Capital Bra namens „Auf!Keinen!Fall!“, betreut Laura die derzeit wohl most hyped female Artist LAYLA und Allroundtalent ROLA als Artist Managerin.  Als externe Produktmanagerin betreut sie diverse Projekte für verschiedene Labels und entwickelte unter anderem das Anfangs Artist Konzept des nationales Top-Acts JAMULE mit. Seit dem Start Ihrer Selbstständigkeit im Jahr 2020 konzentriert Sie sich vor allem auf Artist Development, Brand Building und Artist Positionierung. Sie hat früh erkannt dass, die Vernetzung von Künstlern mit Brands  ein wichtiges und erfolgsversprechendes Karrieretool ist. ",
