        "name": "Karl Kani",
        "descriptionDe": "Für viele gilt Karl Kani als der Erfinder von Streetwear. Bereits 1989 gründete der legendäre Modedesigner aus Kalifornien das Label. Innovative Marketingstrategien und prominente Supporter und Fans wie Tupac, B.I.G. und Aaliyah machten die Marke schnell auf der ganzen Welt bekannt und bis heute zu einem Household-Name in der Hip-Hop- sowie Streetwear-Community.",
        "descriptionEn": "Karl Kani is a legendary fashion designer based in California, United States, who took the world by storm in 1989 when he launched his self-titled urban wear clothing line which remains a household favorite for over 30 years. Karl credits his success to his ingenious way of thinking and his innovative marketing strategies. The Karl Kani brand catapulted even further with endorsements from the iconic Tupac, B.I.G, and Aaliyah among others; showing the world how stylish, relevant, and important to the Hip Hop Community and streetwear globally. Karl Kani is truly the originator of streetwear style, paving the way through his incentive designs that appealed to the ordinary guy and the A-List celebrity.",
