        "name": "Christoph  von Reibnitz",
        "descriptionDe": "Targeting ohne Cookies? Christoph von Reibnitz ist seit über 11 Jahren bei Vibrant Media tätig, dem Vorreiter und weltweit führenden Anbieter im Contextual Advertising. Davon mittlerweile mehr als 4 Jahre als Geschäftsführer (D-A-CH Markets). Spätestens mit Google’s Ankündigung Third-Party-Cookies nicht mehr zu unterstützen sucht der Markt nach neuen Lösungen. Mit Quintesse, einer neuen SaaS-Lösung, können Advertiser und Agenturen jetzt Vibrant Medias über 20-jähriges Know-how im kontextuellen Targeting nutzen, um Kampagnen relevant, brandsafe, cookie-free und 100 % DSGVO-konform mittels DSPs über Curated Marketplaces oder die Integration von Contextual Segments programmatisch in Realtime aussteuern.",
        "descriptionEn": "Targeting without cookies? Christoph von Reibnitz has been with Vibrant Media, the pioneer and global leader in contextual advertising, for over 11 years. More than four years as managing director (D-A-CH Markets). At the latest, with Google's announcement that it will no longer support third-party cookies, the market is looking for new solutions. With Quintesse, a new SaaS solution, advertisers and agencies can now leverage Vibrant Media's 20+ years of contextual targeting know-how to deliver campaigns that are relevant, brand-safe, cookie-free and 100% GDPR compliant using DSPs via curated marketplaces or the integration of contextual segments programmatically in real-time.",
