        "name": "Juliane Leicht",
        "descriptionDe": "Leicht zu merken, schwer zu vergessen: Juliane Leicht arbeitet seit 2018 beim Onlinehändler SportSpar. Für den Off-Price-Onlineshop, den Fans spätestens seit dem OMR-Podcast #187 kennen, leitet die 30-Jährige seit 2020 das Marketing. Zudem verantwortet sie den Leipziger Creative Hub der Marke. Neben Erstellung, Planung und Umsetzung sämtlicher Marketingmaßnahmen gehören CRM und die Optimierung der User Experience zu Julianes Steckenpferden. Sie weiß genau, was die Zielgruppe des dynamischen Unternehmens will. Die international ausgerichteten Studienabschlüsse in Düsseldorf und Berlin förderten die interkulturelle Kompetenz, die den 6 int. Subshops zu Gute kommt. Enthusiasmus und Expertise zeichnen die Powerfrau aus. ",
        "descriptionEn": "Juliane Leicht has been working for the online shop SportSpar since May 2018. The 30-year-old is in charge of the marketing department for the off-price ecommerce company. She manages the brands creative hub in Leipzig with 3 different departments. In addition to creating, planning and implementing all marketing measures, She is also specialized in CRM and the optimization of the user experience. She precisely keeps an eye on the needs of the dynamic companys‘ target groups. Her internationally oriented Bachelor and Master degrees in Düsseldorf and Berlin promoted intercultural competence, which benefits SportSpar‘s 6 international sub-shops. Additionally to her hard skills the power woman can be characterized by enthusiasm and expertise.",
