        "name": "David Raab",
        "descriptionDe": "David M. Raab ist Gründer und CEO des Customer Data Platform Institute www.cdpinstitute.org, einer anbieterneutralen Organisation mit über 11.000 Mitgliedern, die Marketingspezialisten und Technologen über Kundendatenmanagement schult. Herr Raab hat 2013 die Kategorie Customer Data Platform benannt und blickt auf eine lange Geschichte als unabhängiger Berater zurück, der Marketingfachleuten hilft, Marketingtechnologien und -anbieter zu verstehen, zu finden und einzusetzen. Zu seinen Kunden zählen Global 2000-Unternehmen in den Bereichen Einzelhandel, Finanzdienstleistungen, Telekommunikation, Verlagswesen, Technologie und anderen Branchen. Er begann seine Karriere als Vermarkter im Verlagswesen und in der Kontinuität.",
