        "name": "Tim Wiegels",
        "descriptionDe": "Dr. Tim Wiegels ist ein absoluter Experte in Sachen Daten mit einem Hintergrund in der akademischen Welt sowie in der Mobilitäts-, Gesundheits-, Gaming- und allgm. Technologie- und Internetbranche. Mit seiner pragmatischen, strukturierten Denkweise hat er erfolgreich Teams für Data Science, Machine Learning, Data Analytics und Engineering aufgebaut und erweitert. Tims ausgeprägte hands-on und can-do Einstellung wird durch seine Erfahrung in politischer Lobbyarbeit und Einflussnahme auf Gesetzgeber & Entscheidungsträger ergänzt.Tim befähigt Menschen und Unternehmen, datenorientiert zu denken und zu handeln, indem er ihnen die richtigen Werkzeuge, Plattformen und Datenunterstützung zur Verfügung stellt, um ihren Bereich voran zu bringen!",
